insert  into `daftar_film`(`id_film`,`judul`,`sinopsis`,`durasi`,`kategori`,`awal_tayang`,`akhir_tayang`,`kualitas`,`rating`) values (1,'IN THE HEART OF THE SEA','Pada bulan Agustus 1819 sebuah tim yang terdiri dari 21 orang menggunakan kapal penangkap ikan paus berlayar untuk belajar hal baru di luar sana. Namun kapal tersebut diserang oleh sesuatu yang tidak dapat dipercaya oleh siapapun, Paus ukuran raksasa meny',121,' Action, Adventure, Biography','2015-12-05','2015-12-31','imax',3),(2,'POINT BREAK','Agen FBI, Johnny Utah (Luke Bracey) mendapat tugas untuk menyamar ke sebuah organisasi berbahaya. Keahlian Johnny beraksi olahraga ekstrem membuatnya dengan mudah masuk ke dalam kelompok yang dipimpin oleh Bodhi (Edgar Ramirez).',113,' Action, Crime, Sport','2015-12-05','2015-12-31','hd',5);

